$(document).ready(function(){$("#givenTable").hide();$("#btnUploadFile").on("click",function(){var t=new FormData,n=$("#fileUpload").get(0).files,r;n.length>0&&t.append("files",n[0]);r=$.ajax({type:"POST",url:"/Uploader",contentType:!1,processData:!1,data:t});r.done(function(t){if(t.status==!0){$("#givenTable").show();$("#displayGrid > tr").remove();var r=$.ajax({type:"GET",url:"/View/FetchRecords/",dataType:"json",data:{myfile:n[0].name},success:function(n){if(n=n.data,n.length!=0)for(i=0;i<n.length;++i){var t="<tr><td class='table-bordered'><div class=\"RequestDetailsTR\">"+n[i].dealNumber+"<\/div><\/td><td class='table-bordered'><div class=\"RequestDetailsTR\">"+n[i].customerName+"<\/div><\/td><td class='table-bordered'><div class=\"RequestDetailsTR\">"+n[i].dealershipName+"<\/div><\/td><td class='table-bordered'><div class=\"RequestDetailsTR\">"+n[i].vehicle+"<\/div><\/td><td class='table-bordered'><div class=\"RequestDetailsTR\">CAD$"+n[i].price+"<\/div><\/td><td class='table-bordered'><div class=\"RequestDetailsTR\">"+n[i].date+"<\/div><\/tr>";$("#displayGrid").append(t)}}})}else alert(t.message)})})});